  ];

  return (
    <>
      <div className="contact_add">
        <ContactAdder />
      </div>
      <div className="contact_list">
        <h3>Contact List:</h3>
        <div className="contact">
          {contacts.map((data) => (
            <Contact data={data} />
          ))}
          <Contact data={contacts[0]} />
          <Contact data={contacts[1]} />
